import axios from "axios";

export const getPositionByName = (name) => {
    const {API_BASE_URL}= process.env
   return axios.get(`${process.env.API_BASE_URL}position/${name}`)
    .then((data) => {
        return data
    })
    .catch((error) => console.error(error));
};
